import React from "react";
import { FormGroup, FormControlLabel, Checkbox, FormLabel } from "@material-ui/core";


const CheckBoxInfo = ({ userData, setUserData }) => {
    return (
        <FormGroup row>
        <FormLabel>What types of runs do you like to do?</FormLabel>
            <FormControlLabel control={<Checkbox name="ez" onChange={(e) => setUserData({ ...userData, result: { ...userData.result, public: {...userData.result.public, typesOfRuns: {...userData.result.public.typesOfRuns, easy: e.target.value}}}})}/>} label="Easy" />
            <FormControlLabel control={<Checkbox name="wo" />} label="Workouts" />
            <FormControlLabel control={<Checkbox name="lr" />} label="Long Runs" />
            <FormControlLabel control={<Checkbox name="hill" />} label="Hills" />
            <FormControlLabel control={<Checkbox name="flat" />} label="Flat" />
            <FormControlLabel control={<Checkbox name="trails" />} label="Trials" />
        </FormGroup>
      );
}

export default CheckBoxInfo;
